    49190: t => {
      t.exports =
        '<p>For stick columns use our <a href="/components/sticky">PrizmStickModule</a></p>\n\n<h3>Sticky Left</h3>\n<prizm-scrollbar class="scrollable">\n  <table class="table" prizmTable size="l" prizmStickyRelative>\n    <thead>\n      <tr prizmThGroup>\n        <th [prizmStickyLeft]="true" [style.z-index]="21" prizmTh>\u041a\u043e\u0434</th>\n        <th [prizmStickyLeft]="true" [style.z-index]="21" prizmTh>SL:\u041d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435</th>\n        <th prizmTh>\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f</th>\n        <th prizmTh>\u041a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e</th>\n        <th prizmTh>\u041d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435 2</th>\n        <th prizmTh>\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f 2</th>\n        <th prizmTh>\u041a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e 2</th>\n      </tr>\n    </thead>\n\n    <tbody [data]="products" prizmTbody>\n      <ng-container\n        *prizmRow="\n          let item of products;\n          let i = index;\n          let odd = odd;\n          let even = even;\n          let first = first;\n          let last = last\n        "\n      >\n        <tr prizmTr>\n          <td class="format__number" [prizmStickyLeft]="true" prizmTd>\n            {{ item.code | spaceNumber : \'0.0-0\' }}\n          </td>\n          <td [prizmStickyLeft]="true" prizmTd>\n            {{ item.name }}<br />\n            {{ odd ? \'#odd\' : \'#even\' }}\n            {{ first ? \'#first\' : \'\' }}\n            {{ last ? \'#last\' : \'\' }}\n          </td>\n          <td prizmTd>{{ item.category }}</td>\n          <td class="format__number" prizmTd>{{ item.count | spaceNumber : \'0.0-0\' }}</td>\n          <td prizmTd>{{ item.name }}</td>\n          <td prizmTd>{{ item.category }}</td>\n          <td class="format__number" prizmTd>{{ item.count | spaceNumber : \'0.0-0\' }}</td>\n        </tr>\n      </ng-container>\n    </tbody>\n  </table>\n</prizm-scrollbar>\n\n<h3>Sticky Right</h3>\n<prizm-scrollbar class="scrollable" prizmStickyRelative>\n  <table class="table" prizmTable size="m">\n    <thead>\n      <tr prizmThGroup>\n        <th prizmTh>\u041a\u043e\u0434</th>\n        <th prizmTh>\u041d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435</th>\n        <th prizmTh>\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f</th>\n        <th prizmTh>\u041a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e</th>\n        <th prizmTh>\u041d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435</th>\n        <th [prizmStickyRight]="true" prizmTh>\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f 2</th>\n        <th [prizmStickyRight]="true" prizmTh>\u041a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e 1</th>\n      </tr>\n    </thead>\n\n    <tbody [data]="products" prizmTbody>\n      <ng-container *prizmRow="let item of products; let i = index">\n        <tr prizmTr>\n          <td class="format__number" prizmTd>{{ item.code | spaceNumber : \'0.0-0\' }}</td>\n          <td prizmTd>{{ item.name }}</td>\n          <td prizmTd>{{ item.category }}</td>\n          <td class="format__number" prizmTd>\n            {{ item.count | spaceNumber : \'0.0-0\' }}\n          </td>\n          <td prizmTd>{{ item.name }}</td>\n          <td [prizmStickyRight]="true" prizmTd>{{ item.category }}</td>\n          <td class="format__number" [prizmStickyRight]="true" prizmTd>\n            {{ item.count | spaceNumber : \'0.0-0\' }}\n          </td>\n        </tr>\n      </ng-container>\n    </tbody>\n  </table>\n</prizm-scrollbar>\n\n<h3>Sticky Bottom</h3>\n<prizm-scrollbar class="scrollable">\n  <table class="table" prizmTable size="m" prizmStickyRelative>\n    <thead>\n      <tr prizmThGroup>\n        <th prizmTh>\u041a\u043e\u0434</th>\n        <th prizmTh>\u041d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435</th>\n        <th prizmTh>\u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f</th>\n        <th prizmTh>\u041a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e</th>\n      </tr>\n    </thead>\n\n    <tbody [data]="products" prizmTbody>\n      <ng-container *prizmRow="let item of products; let i = rowIdx">\n        <ng-container>\n          <tr prizmTr>\n            <td class="format__number" prizmTd>{{ item.code | spaceNumber : \'0.0-0\' }}</td>\n            <td prizmTd>{{ item.name }}</td>\n            <td prizmTd>{{ item.category }}</td>\n            <td class="format__number" prizmTd>\n              {{ item.count | spaceNumber : \'0.0-0\' }}\n            </td>\n          </tr>\n        </ng-container>\n\n        <ng-container #footerTemplate *ngIf="$any(i) + 1 === products.length">\n          <tr prizmTr>\n            <td class="format__number" [prizmStickyBottom]="true" prizmTd></td>\n            <td [prizmStickyBottom]="true" prizmTd></td>\n            <td [prizmStickyBottom]="true" prizmTd></td>\n            <td class="format__number" [prizmStickyBottom]="true" prizmTd>\n              {{ sum }}\n            </td>\n          </tr>\n        </ng-container>\n      </ng-container>\n    </tbody>\n  </table>\n</prizm-scrollbar>\n';
    },
